import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';
import './App.css';
import './Footer.css';

class Footer extends Component {
  constructor(props){
    super(props);
    this.state = {
      privacyPolicy: "#",
      instagramLink: '#',
      IMDBLink: '#'
    }
  }
  render() {
    var localCSSclasses = {
      background: 'footerbackground',

    }
    return (
      <div className={localCSSclasses.background}>
      <Container>
        <Row>
          <Col xs="6" sm="6"><link href={this.state.instagramLink}></link></Col>
          <Col xs="6" sm="6"></Col>
        </Row>
      </Container>
      </div>
    );
  }
}

export default Footer;
